import base64

def custom_decode(encoded_text):
    rot13_decoded = encoded_text.translate(
        str.maketrans(
            'NOPQRSTUVWXYZABCDEFGHIJKLMnopqrstuvwxyzabcdefghijklm',
            'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz'
        )
    )
    xor_key = 42
    xor_decoded = ''.join(chr(ord(char) ^ xor_key) for char in rot13_decoded)
    base64_decoded = base64.b64decode(xor_decoded.encode('utf-8')).decode('utf-8')
    return base64_decoded

